import React from 'react';
import { Button, Container, Row, Col } from "react-bootstrap";


function Accomodation() {
  return (
   <div
    class="accomodation"
    style={{
     width: "70%",
     height: "200px",
     minWidth:"350px",
     backgroundColor: "#FFF9E8",
     margin: "auto",
     marginTop: "20px",
     marginBottom:"30px"
    }}
   >
      <h3>1. Mia Resort</h3>
      <h3>2. Fusion Cam Ranh </h3>
      <h3>3. The Anam </h3> 
      <h3>4. Alma Resort </h3> 
      <h3>5. Intercontinental Nha Trang</h3>
    </div> 
  );
}

export default Accomodation;
